emp_blocked_notice\";s:24:\"tatheernoorani@gmail.com\";s:43:\"user_subject_email_user_temp_blocked_notice\";s:31:\"User Temporarily Blocked Notice\";s:43:\"user_formate_email_user_temp_blocked_notice\";i:1;s:36:\"user_enable_user_temp_blocked_notice\";i:1;s:53:\"user_from_name_user_renew_temp_blocked_account_notice\";s:5:\"Admin\";s:54:\"user_from_email_user_renew_temp_blocked_account_notice\";s:24:\"tatheernoorani@gmail.com\";s:52:\"user_to_email_user_renew_temp_blocked_account_notice\";s:24:\"tatheernoorani@gmail.com\";s:57:\"user_subject_email_user_renew_temp_blocked_account_notice\";s:15:\"Payment Failed.\";s:57:\"user_formate_email_user_renew_temp_blocked_account_notice\";i:1;s:50:\"user_enable_user_renew_temp_blocked_account_notice\";i:1;s:39:\"user_from_name_user_perm_blocked_notice\";s:5:\"Admin\";s:40:\"user_from_email_user_perm_blocked_notice\";s:24:\"tatheernoorani@gmail.com\";s:38:\"user_to_email_user_perm_blocked_notice\";s:24:\"tatheernoorani@gmail.com\";s:43:\"user_subject_email_user_perm_blocked_notice\";s:59:\"Notice: User removed because email address was not verfied.\";s:43:\"user_formate_email_user_perm_blocked_notice\";i:1;s:36:\"user_enable_user_perm_blocked_notice\";i:1;s:37:\"user_message_email_admin_verification\";s:217:\"<p>Dear %user_login%,</p><p>Thank You for registering with our website. </p><p>A site administrator will review your request. Once approved, you will be notified via email.</p><p>Best Wishes,</p><p>Team %blogname%</p>\";s:37:\"user_message_email_email_verification\";s:202:\"<p>Dear %user_login%,</p><p>Thank You for registering with our website. </p><p>Please use the link below to verify your email address. </p><p>%activationurl%</p><p>Best Wishes,</p><p>Team %blogname%</p>\";s:33:\"user_message_email_email_thankyou\";s:233:\"<p>Dear %user_login%,</p><p>Thank You for registering with our website. </p><p>You are ready to enjoy the benefits of our products and services by signing in to your personalized account.</p><p>Best Regards,</p><p>Team %blogname%</p>\";s:34:\"user_message_email_payment_success\";s:198:\"<p>Dear %user_login%,</p><p>Congratulations, your payment has been successfully processed. <br/>Please enjoy the benefits of your membership on %blogname% </p><p>Thank You,</p><p>Team %blogname%</p>\";s:32:\"user_message_email_payment_faild\";s:325:\"<p>Dear %user_login%,</p><p>Our last attempt to charge the membership payment for your account has failed. </p><p>You are requested to log in to your account at %blogname% to provide a different payment method, or contact your bank/credit-card company to resolve this issue.</p><p>Kind Regards,</p><p>Team %blogname%<br/></p>\";s:34:\"user_message_email_pending_payment\";s:238:\"<p>Dear %user_login%,</p><p>This is a reminder that membership payment is overdue for your account on %blogname%. Please process your payment immediately to keep membership previlages active. </p><p>Best Regards,</p><p>Team %blogname%</p>\";s:35:\"user_message_email_default_template\";s:232:\"<p>Dear %user_login%,</p><p>Thank You for registering with our website.</p><p>You are ready to enjoy the benefits of our products and services by signing in to your personalized account.</p><p>Best Regards,</p><p>Team %blogname%</p>\";s:43:\"user_message_email_pending_payment_reminder\";s:328:\"<p>Dear %user_login%,</p><p>We have noticed that you created an account on %blogname% a few days ago, but have not completed the payment. Please use the link below to complete the payment. <br/>Your account will be activated once the payment is received.</p><p>%pending_payment_url%</p><p>Best Regards,</p><p>Team %blogname%</p>\";s:46:\"user_message_email_email_verification_reminder\";s:317:\"<p>Dear %user_login%,</p><p>Thank You for registering with our website. </p><p>We noticed that you created an account on %blogname% but have not completed the email verification process. </p><p>Please use the link below to verify your email address. </p><p>%activationurl%</p><p>Best Wishes,</p><p>Team %blogname%</p>\";s:47:\"user_message_email_forgot_password_notification\";s:326:\"<p>Dear %user_login%,</p><p>We have received a request to reset your account password on %blogname%. Please use the link below to reset your password. If you did not request a new password, please ignore this email and the change will not be made.</p><p>( %reset_password_url% )</p><p>Best Regards,</p><p>Team %user_login%</p>\";s:37:\"user_message_email_user_expiry_notice\";s:376:\"<p>Dear %user_login%,</p><p>Thank You for registering with our website. </p><p>We noticed that you created an account on %blogname% but have not completed the email verification process. Failure to do so will result in your account being removed.</p><p>Please use the link below to verify your email address. </p><p>%activationurl%</p><p>Best Wishes,</p><p>Team %blogname%</p>\";s:43:\"user_message_email_user_temp_blocked_notice\";s:41:\"You are temporarily blocked at %blogname%\";s:57:\"user_message_email_user_renew_temp_blocked_account_notice\";s:410:\"<p>Dear %user_login%,</p><p>Our last attempt to charge the membership payment for your account has failed. </p><p>You are requested to log in to your account at %blogname% to provide a different payment method, or contact your bank/credit-card company to resolve this issue. </p><p>Access to your account has been temporarily disabled until this issue is resolved.</p><p>Kind Regards,</p><p>Team %blogname%</p>\";s:43:\"user_message_email_user_perm_blocked_notice\";s:240:\"<p>Dear %user_login%,</p><p>You were required to verify your account, but you failed to do so within grace period. So, your account is being removed from %blogname%. You need to register again. </p><p>Kind Regards,</p><p>Team %blogname%</p>\";s:42:\"user_message_email_email_edit_verification\";s:317:\"<p>Hello %user_login%,</p><p>We have received a request to change the email address for your account on %blogname%.</p><p>Old Email Address: %user_email%<br/>New Email Address: %user_new_email%. </p><p>Please use the link below to complete this change.</p><p>(%reset_email_url%)</p><p>Thanks</p><p>%blogname%<br/></p>\";s:45:\"user_message_email_current_email_verification\";s:426:\"<p>Hello %user_login%,</p><p>We have received a request to change the email address for your account on %blogname%.</p><p>Old Email Address: %user_email%<br/>  New Email Address: %user_new_email%. </p><p>If you requested this change, please use the link below to complete the action. Otherwise please ignore this email and the change will not be made.</p><p>(%confirm_current_email_url%)</p><p>Thanks</p><p>%blogname%<br/></p>\";}', 'yes'),
