--
-- Table structure for table `wp_pf_entries`
--

CREATE TABLE `wp_pf_entries` (
  `id` int(11) NOT NULL,
  `form_id` int(11) DEFAULT NULL,
  `user_id` bigint(20) DEFAULT NULL,
  `user_device` varchar(100) DEFAULT NULL,
  `user_ip_address` varchar(100) DEFAULT NULL,
  `referer` text DEFAULT NULL,
  `viewed` tinyint(1) DEFAULT NULL,
  `starred` tinyint(1) DEFAULT NULL,
  `fields` longtext DEFAULT NULL,
  `status` varchar(20) DEFAULT NULL,
  `created_at` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp()
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

-- --------------------------------------------------------

--
-- Table structure for table `wp_pf_entrymeta`
--

CREATE TABLE `wp_pf_entrymeta` (
  `id` int(11) NOT NULL,
  `entry_id` int(11) DEFAULT NULL,
  `meta_key` longtext DEFAULT NULL,
  `meta_value` longtext DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

-- --------------------------------------------------------

--
-- Table structure for table `wp_pf_fields`
--

CREATE TABLE `wp_pf_fields` (
  `id` int(11) NOT NULL,
  `form_id` int(11) DEFAULT NULL,
  `form_title` longtext DEFAULT NULL,
  `form_data` longtext DEFAULT NULL,
  `form_type` varchar(15) DEFAULT NULL,
  `created_at` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  `updated_at` datetime DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

